package medium_0467

import "testing"

func TestFindSubstringInWraproundString(t *testing.T) {
	var fsiws = []struct {
		p        string
		expected int
	}{
		//{"cac", 2},
		//{"zabd", 7},
		//{"zabcdefghijklmnopqrstuvwxyzabcdefghijklmnopqrs", 871},
		//{"", 33475},
		//{"", 349},
		{"", 259259},
	}

	for _, val := range fsiws {
		actual := findSubstringInWraproundString(val.p)

		if actual != val.expected {
			t.Error("Test Failed!", actual, val.expected, val.p)
		}
	}
}
